  summary: >-
    Represents a WHILE loop command in the BOOSE language.

    Inherits from <xref href="BOOSEide.AppCompoundCommand" data-throw-if-not-resolved="false"></xref> to allow a block

    of commands to be repeatedly executed while a condition remains true.
  remarks: >-
    The actual evaluation of the loop condition and control of program flow

    are handled by the BOOSE execution engine and the corresponding END command.

    This class primarily exists to integrate WHILE into the programâ€™s command set.
